import React from 'react';
import './Order.css';


const Order = (props)=>{
    return(
    <div className="Order">
        <p>Ingredients : {props.ingredients}</p>
        <p>Price : <strong>Euro {props.price}</strong></p>
    </div>
    );
}

export default Order
